type PageStyle struct {
	ML                    float64 // margen izq
	MT                    float64 // margen sup
	MR                    float64 // margen der
	MB                    float64 // margen inf
	WW                    float64 // ancho area trabajo
	HW                    float64 // alto area trabajo
	HH                    float64 // alto header
	HB                    float64 // alto body
	HF                    float64 // alto footer
	WC                    float64 // ancho columna
	HR                    float64 // alto celda
	BaseColorRGB          [3]int
	SecondaryColorRGB     [3]int
	ComplementaryColorRGB [3]int
}

func getPageStyle(pdf *gofpdf.Fpdf) PageStyle {
	widthPage, heightPage := pdf.GetPageSize()
	l, t, r, b := pdf.GetMargins()
	pageStyle := PageStyle{
		ML: l,
		MT: t,
		MR: r,
		MB: b,
		WW: widthPage - l - r,
		HW: heightPage - (2 * t),
		HH: 0,
		HB: heightPage,
		HF: 0,
		WC: 0,
		HR: 6}

	// gray for headers
	pageStyle.BaseColorRGB[0] = 201
	pageStyle.BaseColorRGB[1] = 201
	pageStyle.BaseColorRGB[2] = 201

	return pageStyle
}

func FontStyle(pdf *gofpdf.Fpdf, style string, size float64, bw int, fontFamily string) {
	pdf.SetTextColor(bw, bw, bw)

	if fontFamily == "" {
		fontFamily = "Arial"
	}
	pdf.SetFont(fontFamily, style, size)
}

func drawLogo(pdf *gofpdf.Fpdf, pageStyle PageStyle) *gofpdf.Fpdf {
	logoBase64 := ""
	pdf.SetXY(pageStyle.ML, pageStyle.MT)
	FontStyle(pdf, "B", 6.5, 0, "Helvetica")
	pdf.CellFormat(pageStyle.WC*2, 45, "", "1", 0, "CM", false, 0, "")
	file, err := base64.StdEncoding.DecodeString(logoBase64)
	if err != nil {
		fmt.Println("Read image. In logo function")
		fmt.Println(err)
	}
	reader := bytes.NewReader(file)
	_ = pdf.RegisterImageOptionsReader("logo.png", gofpdf.ImageOptions{ImageType: "png", AllowNegativePosition: true}, reader)
	WLogo := 27.0
	pdf.ImageOptions("logo.png", pageStyle.WC-(WLogo/2.0)+pageStyle.ML, pageStyle.MT+1, WLogo, 42, false,
		gofpdf.ImageOptions{ImageType: "png"}, 0, "")
	return pdf
}

